window.bookSummaryJSON = "<p>Naomi Novik delivers the final adventure in a <i>New York Times</i> best-selling series that has won fans of Napoleonic-era military history, Anne McCaffrey's Pern novels, and Patrick O'Brian's seafaring adventures. Since <i>His Majesty's Dragon</i>, Captain William Laurence and his fearless dragon, Temeraire, have been battling Napoleon and his armies...and now the time has come to stop him for good.</p>"; 
